def convert_full_tag_into_label(country_tag=None, writing_script_tag=None, territory_tag=None):
    label = ""
    # append country
    language = pycountry.languages.get(alpha_2 = country_tag)

    # if no alpha 2 attribute, try alpha3
    if not language:
        language = pycountry.languages.get(alpha_3 = country_tag)

    if language != None:
        label += language.name

    # append territory
    if territory_tag != None:
        label += "-"
        territory = pycountry.countries.get(alpha_2 = territory_tag.upper())
        if territory == None:
            label += "Unknown"
        else:
            label += territory.name
    
    # append writing script
    if writing_script_tag != None:
        label += " ("

        script = pycountry.scripts.get(alpha_4 = writing_script_tag)
        if script == None:
            label += "Unknown"
        else:
            label += script.name

        label += ")"

    return label


