    tags = code["lang"].split("-")

    if len(tags) == 1: # country
        entry["label"] = convert_full_tag_into_label(entry["country_tag"])

    if len(tags) == 2:
        # find if tag[1] is a script or a territory
        # if a writing script
        if tags[1] in writing_scripts:
            entry["label"] = convert_full_tag_into_label(tags[0], tags[1])
        else:
            entry["label"] = convert_full_tag_into_label(country_tag=tags[0], territory_tag=tags[1])

    if len(tags) == 3: # country-script-territory
        entry["writing_script_tag"] = tags[1]
        entry["label"] = convert_full_tag_into_label(tags[0], tags[1], tags[2])

    print(entry)

